import React, { Component } from "react";
import CV from "./Components/CV/CV";
import "./App.css";

class App extends Component {
  constructor(props) {
    super(props);

    this.state = {
      cv_data: {
        about: {
          name: "",
          surname: "",
          email: "",
          address: "",
          phone: ""
        },
        education: [
          {
            name: "",
            start: "",
            end: ""
          }
        ],
        experience: [
          {
            name: "",
            start: "",
            end: ""
          }
        ],
        extraInfo: [
          {
            skills: [],
            languages: []
          }
        ]
      }
    };

  }

  setName = (name) => {
    this.setState(
      { 
        cv_data: {...this.state.cv_data, 
          about: {
            name: name.target.value
          }
        }
      }
    );
  }

  setSurname = (surname) => {
    this.setState(
      { cv_data: {...this.state.cv_data, 
          about: {
            surname: surname.target.value
          }
        }
      }
    );
  }

  render() {

    const { cv_data } = this.state;

    return (
      <div className="App">
        <div id="inputs">
          <div id="aboutInp">
            <h3>About you</h3>
            <label htmlFor="name">Name: </label>
            <input id="name" name="name" onChange={e => this.setName(e)} />
            <label htmlFor="surname">Surname: </label>
            <input id="surname" name="surname" onChange={e => this.setSurname(e)}/>
            <label htmlFor="name">Email: </label>
            <input id="email" name="email" />
            <label htmlFor="address">Address: </label>
            <input id="address" name="address" />
            <label htmlFor="phone">Phone number: </label>
            <input id="phone" name="phone" />
            <label htmlFor="description">About you: </label>
            <textarea id="description" name="description" rows="10" cols="80" />
          </div>
          <div id="educationInp">
            <h3>Education</h3>
            <label htmlFor="eduName">Institution's name: </label>
            <input id="eduName" name="eduName" />
            <label htmlFor="startDate">Start date: </label>
            <input type="date" id="startDate" name="startDate" />
            <label htmlFor="graduationDate">Graduation date: </label>
            <input type="date" id="graduationDate" name="graduationDate" />
          </div>
          <div id="experienceInp">
            <h3>Work experience</h3>
            <label htmlFor="expName">Company's name: </label>
            <input id="expName" name="expName" />
            <label htmlFor="posOccupied">Position occupied: </label>
            <input id="posOccupied" name="posOccupied" />
            <label htmlFor="workStart">Start date: </label>
            <input type="date" id="workStart" name="workStart" />
            <label htmlFor="workEnd">End date: </label>
            <input type="date" id="workEnd" name="workEnd" />
          </div>
          <div id="extraInfoInp">
            <div id="skillsInp">
              <h3>Skills</h3>
              <input type="text" name="skill1" />
              <input type="text" name="skill2" />
              <input type="text" name="skill3" />
              <button type="button" id="addSkill">Add a skill</button>
            </div>
            <div id="languagesInp">
              <h3>Languages</h3>
              <input type="text" name="language1" />
              <input type="text" name="language2" />
              <input type="text" name="language3" />
              <button type="button" id="addLanguage">Add a language</button>
            </div>
          </div>
        </div>
        <CV data={cv_data}/>
      </div>
    );
  }
}

export default App;
